void OAIAutopilotV1SampleApi::updateSample(const QString &assistant_sid, const QString &task_sid, const QString &sid, const ::OpenAPI::OptionalParam<QString> &language, const ::OpenAPI::OptionalParam<QString> &source_channel, const ::OpenAPI::OptionalParam<QString> &tagged_text) {
    QString fullPath = QString(_serverConfigs["updateSample"][_serverIndices.value("updateSample")].URL()+"/v1/Assistants/{AssistantSid}/Tasks/{TaskSid}/Samples/{Sid}");
    
    if (!_username.isEmpty() && !_password.isEmpty()) {
        QByteArray b64;
        b64.append(_username.toUtf8() + ":" + _password.toUtf8());
        addHeaders("Authorization","Basic " + b64.toBase64());
    }
    
    {
        QString assistant_sidPathParam("{");
        assistant_sidPathParam.append("AssistantSid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "AssistantSid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"AssistantSid"+pathSuffix : pathPrefix;
        fullPath.replace(assistant_sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(assistant_sid)));
    }
    
    {
        QString task_sidPathParam("{");
        task_sidPathParam.append("TaskSid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "TaskSid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"TaskSid"+pathSuffix : pathPrefix;
        fullPath.replace(task_sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(task_sid)));
    }
    
    {
        QString sidPathParam("{");
        sidPathParam.append("Sid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "Sid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"Sid"+pathSuffix : pathPrefix;
        fullPath.replace(sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(sid)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    if (language.hasValue())
    {
        input.add_var("Language", ::OpenAPI::toStringValue(language.value()));
    }
    if (source_channel.hasValue())
    {
        input.add_var("SourceChannel", ::OpenAPI::toStringValue(source_channel.value()));
    }
    if (tagged_text.hasValue())
    {
        input.add_var("TaggedText", ::OpenAPI::toStringValue(tagged_text.value()));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIAutopilotV1SampleApi::updateSampleCallback);
    connect(this, &OAIAutopilotV1SampleApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

